					</a>
					<a href="">
						<label>
							YouTube
							<img src="https://img.icons8.com/ios-glyphs/30/000000/youtube-play.png" />
						</label>
					</a>
					<a href="https://github.com/milesuno">
						<label>
							Github
							<img src="https://img.icons8.com/ios-glyphs/30/000000/github.png" />
						</label>
					</a>
				</div>
			</nav>
		);
	}
}

export default SocialMediaNav;
